If you've ever lost someone, got divorced, or had any big life change, you know.

People expect you to be 'over it' very quickly.

It's the same with having a baby. We've all grown up with, and internalised ideas of 'getting your body back'. How many magazine covers have scrutinised a celebrity's body after having a baby, to see if she still had a tummy?

It's like we expect people to go through massive life changes but for that change to leave no impact. And of course, we do it to ourselves. When you're in the thick of change or grief, all you want is for life to go back to normal.

But we change, we grow. That's human.

We may end up with scars but we may also come out the other side of experiences with blessings we couldn't have imagined.

That's why you won't hear me talk about weight loss or 'bouncing back' in postpartum nutrition.

What you will hear me talk about is warmth. Comfort foods. Foods that lower your stress and raise your oxytocin. Getting enough energy so breastfeeding isn't exhausting. Replenishing the minerals that might be depleted after pregnancy and birth. Foods that can be cooked for you, not by you.

Because your body didn't go anywhere. You don't need to get it back. In this moment it needs you more than ever to love it.

